('page', 0, 5, 5, 'en', 0, '<h3>Introduction</h3>\r\n\r\n<p><a href="http://www.morethanthemes.com/&amp;mt-referral=scholarlylite" target="_blank">More than (just) Themes</a>&nbsp;proudly presents some of the best Drupal, HTML &amp; PSD themes &amp; toolsets around. Some&nbsp;<a href="http://www.drupalizing.com/" target="_blank">awesome freebies</a>&nbsp;too. With pixel-perfect design, automated installation procedure, unique support and detailed installation instructions, all created by people you can easily reach, people like you; bloggers, web designers, coders and Drupal geeks.</p>\r\n\r\n<h3>About News+ Lite and Our Mission</h3>\r\n\r\n<p>News+ Lite is a free, news/portal theme for Drupal 8 built on Bootstrap 3 and our popular <a href="http://www.morethanthemes.com/?q=themes/newsplus">News+ Premium theme for Drupal 7</a>.</p>\r\n\r\n<blockquote>\r\n<p>News+ Lite has been contributed to Drupal and is supported by&nbsp;<a href="http://www.morethanthemes.com/&amp;mt-referral=scholarlylite" target="_blank">More than (just) Themes</a>, as part of our ongoing effort to bring top quality themes to the Drupal community.&nbsp;</p>\r\n</blockquote>\r\n\r\n<p>You can use News+ Lite without any limitations for your personal or commercial projects. Although attribution is very much appreciated, it is not required.</p>\r\n\r\n<h4>Support &amp; Contact us</h4>\r\n\r\n<p>In addition to our Premium Drupal products, at More than (just) Themes we will continue to release, maintain, improve and enrich our free themes with new features.&nbsp;</p>\r\n\r\n<p>Members of our team participate actively and help out in support requests to the maximum extent possible. Nevertheless, sometimes there might be needs related to a theme that go beyond the typical support and knowledge sharing and require either premium support or even implementation-on-request. In all such cases, do not hesitate to <a href="http://www.morethanthemes.com/&amp;mt-referral=scholarlylite" target="_blank">get in touch with us</a> :)</p>\r\n', '', 'full_html');
